import { Link } from "react-router-dom";
import "./style.css";
const Reset = () => {
  return (
    <div className="reset">
      <div className="reset_header">
        <img src="../../../icons/facebook.svg" alt="" />
        <Link to="/login" className="right_reset"></Link>
      </div>
    </div>
  );
};

export default Reset;
